INSERT INTO abilities
VALUES
	(77, 'tangled feet', 4, 'When this Pokmon is confused, it has twice its evasion.', 'Raises evasion if the Pokmon is confused.', NULL, NULL, NULL, '5');
INSERT INTO abilities
VALUES
	(165, 'aroma veil', 6, 'Protects allies against moves that affect their mental state.', 'Protects allies from attacks that limit their move choices.', 'Protects itself and its allies from attacks that limit their move choices.', NULL, NULL, '15,17');
INSERT INTO abilities
VALUES
	(3, 'speed boost', 3, 'This Pokmon''s Speed rises one stage after each turn.', 'Gradually boosts SPEED.', 'The Pokmon''s Speed stat is gradually boosted.', 'Its Speed stat is gradually boosted.', 'Its Speed stat is boosted every turn.', '5,8,10,17,');
INSERT INTO abilities
VALUES
	(197, 'shields down', 7, 'When this Pokmon enters battle and at the end of each turn, if its HP is 50% or above, it changes into Meteor Form; otherwise, it changes into Core Form.  In Meteor Form, it cannot be given a major status ailment (though existing ones are not cured), cannot become drowsy from yawn and cannot use rest (which will simply fail).<br>This ability cannot be copied, replaced, or nullified.  This ability only takes effect for Minior.', 'When its HP becomes half or less, the Pokmon''s shell breaks and it becomes aggressive.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(198, 'stakeout', 7, 'This Pokmon''s moves have double power against Pokmon that switched in this turn.', 'Doubles the damage dealt to the target''s replacement if the target switches out.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(7, 'limber', 3, 'This Pokmon cannot be paralyzed.<br>If a Pokmon is paralyzed and acquires this ability, its paralysis is healed; this includes when regaining a lost ability upon leaving battle.', 'Prevents paralysis.', 'The Pokmon is protected from paralysis.', 'Protects the Pokmon from paralysis.', 'Its limber body protects the Pokmon from paralysis.', '5,8,15,17');
INSERT INTO abilities
VALUES
	(15, 'insomnia', 3, 'This Pokmon cannot be asleep.<br>This causes rest to fail altogether. If a Pokmon is asleep and acquires this ability, it will immediately wake up; this includes when regaining a lost ability upon leaving battle.<br>This ability functions identically to vital-spirit in battle.', 'Prevents sleep.', 'Prevents the Pokmon from falling asleep.', 'The Pokmon is suffering from insomnia and cannot fall asleep.', NULL, '5,8,17');
INSERT INTO abilities
VALUES
	(16, 'color change', 3, 'Whenever this Pokmon takes damage from a move, the Pokmon''s type changes to match the move.<br>If the Pokmon has two types, both are overridden. The Pokmon must directly take damage; for example, moves blocked by a substitute will not trigger this ability, nor will moves that deal damage indirectly, such as spikes.<br>This ability takes effect on only the last hit of a multiple-hit attack.<br>In Pokmon Colosseum and XD: Gale of Darkness, this ability does not take effect on Shadow-type moves.', 'Changes type to foe''s move.', 'Changes the Pokmon''s type to the foe''s move.', 'The Pokmon''s type becomes the type of the move used on it.', NULL, '5,8,11');
INSERT INTO abilities
VALUES
	(31, 'lightning rod', 3, 'All other Pokmon''s single-target electric-type moves are redirected to this Pokmon if it is an eligible target. Other Pokmon''s Electric moves raise this Pokmon''s Special Attack one stage, negating any other effect on it, and cannot miss it.<br>If the move''s intended target also has this ability, the move is not redirected. When multiple Pokmon with this ability are possible targets for redirection, the move is redirected to the one with the highest Speed stat, or, in the case of a tie, to a random tied Pokmon. The move follow-me takes precedence over this ability.<br>If the Pokmon is a ground type and thus immune to Electric moves, its immunity prevents the Special Attack boost.', 'Draws electrical moves.', 'The Pokmon draws in all Electric-type moves.', 'Draws in all Electric-type moves to up Sp. Attack.', 'The Pokmon draws in all Electric-type moves. Instead of being hit by Electric-type moves, it boosts its Sp. Atk.', '5,8,11,17');
INSERT INTO abilities
VALUES
	(33, 'swift swim', 3, 'This Pokmon''s Speed is doubled during rain.<br>This bonus does not count as a stat modifier.', 'Raises SPEED in rain.', 'Boosts the Pokmon''s Speed in rain.', 'Boosts the Pokmon''s Speed stat in rain.', NULL, '5,8,15');
INSERT INTO abilities
VALUES
	(38, 'poison point', 3, 'Whenever a move makes contact with this Pokmon, the move''s user has a 30% chance of being poisoned.', 'Poisons foe on contact.', 'Contact with the Pokmon may poison the foe.', 'Contact with the Pokmon may poison the attacker.', NULL, '5,8,11');
INSERT INTO abilities
VALUES
	(1, 'stench', 3, 'This Pokmon''s damaging moves have a 10% chance to make the target flinch with each hit if they do not already cause flinching as a secondary effect.<br>This ability does not stack with a held item.<br>Overworld: The wild encounter rate is halved while this Pokmon is first in the party.', 'Helps repel wild POKMON.', 'The stench helps keep wild Pokmon away.', 'The stench may cause the target to flinch.', 'By releasing stench when attacking, this Pokmon may cause the target to flinch.', '5,8,11,17');
INSERT INTO abilities
VALUES
	(2, 'drizzle', 3, 'The weather changes to rain when this Pokmon enters battle and does not end unless replaced by another weather condition.<br>If multiple Pokmon with this ability are sent out at the same time, the abilities will activate in order of Speed. Each ability''s weather will cancel the previous weather, and only the weather summoned by the slowest of the Pokmon will stay.', 'Summons rain in battle.', 'The Pokmon makes it rain if it appears in battle.', 'The Pokmon makes it rain when it enters a battle.', 'The Pokmon makes it rain when it enters a battle.', '5,8,15,17');
INSERT INTO abilities
VALUES
	(6, 'damp', 3, 'While this Pokmon is in battle, self-destruct and explosion will fail and aftermath will not take effect.', 'Prevents self-destruction.', 'Prevents combatants from self destructing.', 'Prevents the use of self-destructing moves.', 'Prevents the use of explosive moves such as Self-Destruct by dampening its surroundings.', '5,8,11,17');
INSERT INTO abilities
VALUES
	(4, 'battle armor', 3, 'Moves cannot score critical hits against this Pokmon.<br>This ability functions identically to hell-armor.', 'Blocks critical hits.', 'The Pokmon is protected against critical hits.', 'Protects the Pokmon from critical hits.', 'Hard armor protects the Pokmon from critical hits.', '5,8,15,17');
INSERT INTO abilities
VALUES
	(5, 'sturdy', 3, 'When this Pokmon is at full HP, any hit that would knock it out will instead leave it with 1 HP. Regardless of its current HP, it is also immune to the one-hit KO moves: fissure, guillotine, horn-drill and sheer-cold.<br>If this Pokmon is holding a focus-sash, this ability takes precedence and the item will not be consumed.', 'Negates 1-hit KO attacks.', 'The Pokmon is protected against 1-hit KO attacks.', 'It cannot be knocked out with one hit.', 'It cannot be knocked out with one hit. One-hit KO moves cannot knock it out, either.', '5,8,11,17');
INSERT INTO abilities
VALUES
	(8, 'sand veil', 3, 'During a sandstorm, this Pokmon has 1.25 its evasion, and it does not take sandstorm damage regardless of type.<br>The evasion bonus does not count as a stat modifier.<br>Overworld: If the lead Pokmon has this ability, the wild encounter rate is halved in a sandstorm.', 'Ups evasion in a sandstorm.', 'Boosts the Pokmon''s evasion in a sandstorm.', NULL, NULL, '5,8');
INSERT INTO abilities
VALUES
	(9, 'static', 3, 'Whenever a move makes contact with this Pokmon, the move''s user has a 30% chance of being paralyzed.<br>Pokmon that are immune to electric-type moves can still be paralyzed by this ability.<br>Overworld: If the lead Pokmon has this ability, there is a 50% chance that encounters will be with an electric Pokmon, if applicable.', 'Paralyzes on contact.', 'Contact with the Pokmon may cause paralysis.', 'The Pokmon is charged with static electricity, so
INSERT INTO abilities
VALUES
	(10, 'volt absorb', 3, 'Whenever an electric-type move hits this Pokmon, it heals for 1/4 of its maximum HP, negating any other effect on it.<br>This ability will not take effect if this Pokmon is ground-type and thus immune to Electric moves. Electric moves will ignore this Pokmon''s substitute.<br>This effect includes non-damaging moves, i.e. thunder-wave.', 'Turns electricity into HP.', 'Restores HP if hit by an Electric-type move.', 'Restores HP if hit by an Electric-type move, instead of taking damage.', NULL, '5,8,17');
INSERT INTO abilities
VALUES
	(11, 'water absorb', 3, 'Whenever a water-type move hits this Pokmon, it heals for 1/4 of its maximum HP, negating any other effect on it.<br>Water moves will ignore this Pokmon''s substitute.', 'Changes water into HP.', 'Restores HP if hit by a Water-type move.', 'Restores HP if hit by a Water-type move, instead of taking damage.', NULL, '5,8,17');
INSERT INTO abilities
VALUES
	(12, 'oblivious', 3, 'This Pokmon cannot be infatuated and is immune to captivate.<br>If a Pokmon is infatuated and acquires this ability, its infatuation is cleared.', 'Prevents attraction.', 'Prevents the Pokmon from becoming infatuated.', 'Keeps the Pokmon from being infatuated or falling for taunts.', 'The Pokmon is oblivious, and that keeps it from being infatuated or falling for taunts.', '5,8,15,17');
INSERT INTO abilities
VALUES
	(13, 'cloud nine', 3, 'While this Pokmon is in battle, weather can still be in play, but will not have any of its effects.<br>This ability functions identically to air-lock.', 'Negates weather effects.', 'Eliminates the effects of weather.', NULL, NULL, '5,8');
INSERT INTO abilities
VALUES
	(14, 'compound eyes', 3, 'This Pokmon''s moves have 1.3 their accuracy.<br>This ability has no effect on the one-hit KO moves fissure, guillotine, horn-drill andsheer-cold.<br>Overworld: If the first Pokmon in the party has this ability, the chance of a wild Pokmon holding a particular item is raised from 50%, 5%, or 1% to 60%, 20%, or 5%, respectively.', 'Raises accuracy.', 'The Pokmon''s accuracy is boosted.', 'Boosts the Pokmon''s accuracy.', 'The Pokmon''s compound eyes boost its accuracy.', '5,8,15,17');
INSERT INTO abilities
VALUES
	(17, 'immunity', 3, 'This Pokmon cannot be poisoned. This includes bad poison.<br>If a Pokmon is poisoned and acquires this ability, its poison is healed; this includes when regaining a lost ability upon leaving battle.', 'Prevents poisoning.', 'Prevents the Pokmon from getting poisoned.', 'The immune system of the Pokmon prevents it from getting poisoned.', NULL, '5,8,17');
INSERT INTO abilities
VALUES
	(18, 'flash fire', 3, 'This Pokmon is immune to fire-type moves. Once this Pokmon has been hit by a Fire move, its own Fire moves will inflict 1.5 as much damage until it leaves battle.<br>This ability has no effect while the Pokmon is frozen. The Fire damage bonus is retained even if the Pokmon is frozen and thawed or the ability is lost or disabled. Fire moves will ignore this Pokmon''s substitute. This ability takes effect even on non-damaging moves, i.e. will-o-wisp.', 'Powers up if hit by fire.', 'Powers up Fire-type moves if hit by a fire move.', 'It powers up Fire-type moves if it''s hit by one.', 'Powers up the Pokmon''s Fire-type moves if it''s hit by one.', '5,8,10,15');
INSERT INTO abilities
VALUES
	(19, 'shield dust', 3, 'This Pokmon is immune to the extra effects of moves used against it.<br>An extra effect is a move''s chance, listed as an "effect chance" to inflict a status ailment, cause a stat change, or make the target flinch in addition to the move''s main effect. For example, thunder-shock''s paralysis is an extra effect, but [thunder-wave''s is not, nor are knock-off''s item removal and air-cutter''s increased critical hit rate.', 'Prevents added effects.', 'Blocks the added effects of attacks taken.', 'Blocks the additional effects of attacks taken.', 'This Pokmon''s dust blocks the additional effects of attacks taken.', '5,8,15,17');
INSERT INTO abilities
VALUES
	(20, 'own tempo', 3, 'This Pokmon cannot be confused.<br>If a Pokmon is confused and acquires this ability, its confusion will immediately be healed.', 'Prevents confusion.', 'Prevents the Pokmon from becoming confused.', 'This Pokmon has its own tempo, and that prevents it from becoming confused.', NULL, '5,8,17');
INSERT INTO abilities
VALUES
	(21, 'suction cups', 3, 'This Pokmon cannot be forced out of battle by moves such as whirlwind.<br>Moves dragon-tail and circle-throw still inflict damage against this Pokmon.<br>Overworld: If the lead Pokmon has this ability, the success rate while fishing is increased.', 'Firmly anchors the body.', 'Negates moves that force switching out.', 'Negates all moves that force switching out.', 'This Pokmon uses suction cups to stay in one spot to negate all moves and items that force switching out.', '5,8,10,17');
INSERT INTO abilities
VALUES
	(22, 'intimidate', 3, 'When this Pokmon enters battle, the opponent''s Attack is lowered by one stage. In a double battle, both opponents are affected.<br>This ability also takes effect when acquired during a battle, but will not take effect again if lost and reobtained without leaving battle.<br>This ability has no effect on an opponent that has a substitute.<br>Overworld: If the first Pokmon in the party has this ability, any random encounter with a Pokmon five or more levels lower than it has a 50% chance of being skipped.', 'Lowers the foe''s ATTACK.', 'Lowers the foe''s Attack stat.', 'Lowers the opposing Pokmon''s Attack stat.', 'The Pokmon intimidates opposing Pokmon upon entering battle, lowering their Attack stat.', '5,8,15,17');
INSERT INTO abilities
VALUES
	(23, 'shadow tag', 3, 'While this Pokmon is in battle, opposing Pokmon cannot flee or switch out.<br>Other Pokmon with this ability are unaffected. Pokmon with run-away can still flee. Pokmon can still switch out with the use of a move or item.', 'Prevents the foe''s escape.', 'Prevents the foe from escaping.', 'Prevents opposing Pokmon from escaping.', 'This Pokmon steps on the opposing Pokmon''s shadow to prevent it from escaping.', '5,8,15,17');
INSERT INTO abilities
VALUES
	(24, 'rough skin', 3, 'Whenever a move makes contact with this Pokmon, the move''s user takes 1/8 of its maximum HP in damage.<br>This ability functions identically to iron-barbs.', 'Hurts to touch.', 'Inflicts damage to the foe on contact.', 'Inflicts damage to the attacker on contact.', 'This Pokmon inflicts damage with its rough skin to the attacker on contact.', '5,8,11,17');
INSERT INTO abilities
VALUES
	(25, 'wonder guard', 3, 'This Pokmon is immune to damaging moves that are not super effective against it.<br>Moves that inflict fixed damage, such as night-shade or seismic-toss, are considered super effective if their types are. Damage not directly dealt by moves, such as damage from weather, a status ailment, or spikes, is not prevented.<br>This ability cannot be copied with role-play or traded away with skill-swap, but it can be copied with trace, disabled with gastro-acid, or changed with worry-seed. This Pokmon can still use Role Play itself to lose this ability, but not Skill Swap.<br>If this Pokmon has a substitute, this ability will block moves as usual and any moves not blocked will react to the Substitute as usual.', 'Super effective hits.', 'Only supereffective moves will hit.', 'Its mysterious power only lets supereffective moves hit the Pokmon.', NULL, '5,8,17');
INSERT INTO abilities
VALUES
	(26, 'levitate', 3, 'This Pokmon is immune to ground-type moves, spikes,toxic-spikes, and arena-trap.<br>This ability is disabled during gravity or ingrain, or while holding an iron-ball. This ability is not disabled during roost.', 'Not hit by GROUND attacks.', 'Gives full immunity to all Ground-type moves.', 'By floating in the air, the Pokmon receives full immunity to all Ground-type moves.', NULL, '5,8,17');
INSERT INTO abilities
VALUES
	(27, 'effect spore', 3, 'Whenever a move makes contact with this Pokmon, the move''s user has a 30% chance of being paralyzed, poisoned, or put to sleep, chosen at random.<br>Nothing is done to compensate if the move''s user is immune to one of these ailments; there is simply a lower chance that the move''s user will be affected.', 'Leaves spores on contact.', 'Contact may paralyze, poison, or cause sleep.', 'Contact may poison or cause paralysis or sleep.', 'Contact with the Pokmon may inflict poison, sleep, or paralysis on its attacker.', '5,8,11,17');
INSERT INTO abilities
VALUES
	(28, 'synchronize', 3, 'Whenever this Pokmon is burned, paralyzed or poisoned, the Pokmon who gave this Pokmon that ailment is also given the ailment.<br>This ability passes back bad poison when this Pokmon is badly poisoned. This ability cannot pass on a status ailment that the Pokmon did not directly receive from another Pokmon, such as the poison from toxic-spikes or the burn from a flame-orb.<br>Overworld: If the lead Pokmon has this ability, wild Pokmon have a 50% chance of having the lead Pokmon''s nature, and a 50% chance of being given a random nature as usual, including the lead Pokmon''s nature. This does not work on Pokmon received outside of battle or roaming legendaries.', 'Passes on status problems.', 'Passes on a burn, poison, or paralysis to the foe.', 'Passes poison, paralyze, or burn to the Pokmon that inflicted it.', 'The attacker will receive the same status condition if it inflicts a burn, poison, or paralysis to the Pokmon.', '5,8,15,17');
INSERT INTO abilities
VALUES
	(29, 'clear body', 3, 'This Pokmon cannot have its stats lowered by other Pokmon.<br>This ability does not prevent any stat losses other than stat modifiers, such as the Speed cut from paralysis. This Pokmon can still be passed negative stat modifiers through guard-swap, heart-swap or power-swap.<br>This ability functions identically to ability:white-smoke in battle.', 'Prevents ability reduction.', 'Prevents the Pokmon''s stats from being lowered.', 'Prevents other Pokmon from lowering its stats.', 'Prevents other Pokmon''s moves or Abilities from lowering the Pokmon''s stats.', '5,8,11,17');
INSERT INTO abilities
VALUES
	(30, 'natural cure', 3, 'This Pokmon is cured of any major status ailment when it is switched out for another Pokmon.<br>If this ability is acquired during battle, the Pokmon is cured upon leaving battle before losing the temporary ability.', 'Heals upon switching out.', 'All status problems are healed upon switching out.', 'All status problems heal when it switches out.', 'All status conditions heal when the Pokmon switches out.', '5,8,10,17');
INSERT INTO abilities
VALUES
	(32, 'serene grace', 3, 'This Pokmon''s moves have twice their usual effect chance.<br>An effect chance is a move''s chance to inflict a status ailment, cause a stat change, or make the target flinch in addition to the move''s main effect. For example, flamethrower''s chance of burning the target is doubled, but protect''s chance of success and air-cutter''s increased critical hit rate are unaffected.<br>The move secret-power is unaffected.', 'Promotes added effects.', 'Boosts the likelihood of added effects appearing.', 'Boosts the likelihood of additional effects occurring.', NULL, '5,8,15');
INSERT INTO abilities
VALUES
	(34, 'chlorophyll', 3, 'This Pokmon''s Speed is doubled during strong sunlight.<br>This bonus does not count as a stat modifier.', 'Raises SPEED in sunshine.', 'Boosts the Pokmon''s Speed in sunshine.', 'Boosts the Pokmon''s Speed stat in sunshine.', 'Boosts the Pokmon''s Speed stat in harsh sunlight.', '5,8,15,18');
INSERT INTO abilities
VALUES
	(35, 'illuminate', 3, 'Overworld: If the lead Pokmon has this ability, the wild encounter rate is doubled.<br>This ability has no effect in battle.', 'Encounter rate increases.', 'Raises the likelihood of meeting wild Pokmon.', 'Raises the likelihood of meeting wild Pokmon by illuminating the surroundings.', NULL, '5,8,17');
INSERT INTO abilities
VALUES
	(36, 'trace', 3, 'When this Pokmon enters battle, it copies a random opponent''s ability.<br>This ability cannot copy flower-gift, forecast, illusion, imposter, multitype, trace, wonder-guard, orzen-mode.', 'Copies special ability.', 'The Pokmon copies the foe''s ability.', 'The Pokmon copies an opposing Pokmon''s Ability.', 'When it enters a battle, the Pokmon copies an opposing Pokmon''s Ability.', '5,8,15,17');
INSERT INTO abilities
VALUES
	(37, 'huge power', 3, 'This Pokmon''s Attack is doubled while in battle.<br>This bonus does not count as a stat modifier.<br>This ability functions identically to pure-power.', 'Raises ATTACK.', 'Raises the Pokmon''s Attack stat.', 'Boosts the Pokmon''s Attack stat.', 'Doubles the Pokmon''s Attack stat.', '5,8,15,17');
INSERT INTO abilities
VALUES
	(39, 'inner focus', 3, 'This Pokmon cannot flinch.', 'Prevents flinching.', 'The Pokmon is protected from flinching.', 'Protects the Pokmon from flinching.', 'The Pokmon''s intensely focused, and that protects the Pokmon from flinching.', '5,8,15,17');
INSERT INTO abilities
VALUES
	(40, 'magma armor', 3, 'This Pokmon cannot be frozen.<br>If a Pokmon is frozen and acquires this ability, it will immediately thaw out; this includes when regaining a lost ability upon leaving battle.<br>Overworld: If any Pokmon in the party has this ability, each egg in the party has its hatch counter decreased by 2 (rather than 1) each step cycle, making eggs hatch roughly twice as quickly. This effect does not stack if multiple Pokmon have this ability or flame-body.', 'Prevents freezing.', 'Prevents the Pokmon from becoming frozen.', 'The Pokmon is covered with hot magma, which prevents the Pokmon from becoming frozen.', NULL, '5,8,17');
INSERT INTO abilities
VALUES
	(41, 'water veil', 3, 'This Pokmon cannot be burned.<br>If a Pokmon is burned and acquires this ability, its burn is healed; this includes when regaining a lost ability upon leaving battle.', 'Prevents burns.', 'Prevents the Pokmon from getting a burn.', 'The Pokmon is covered with a water veil, which prevents the Pokmon from getting a burn.', NULL, '5,8,17');
INSERT INTO abilities
VALUES
	(42, 'magnet pull', 3, 'While this Pokmon is in battle, opposing steel-type Pokmon cannot flee or switch out.<br>Pokmon with run-away can still flee. Pokmon can still switch out with the use of a move or item.<br>Overworld: If the lead Pokmon has this ability, Steel-type Pokmon have a higher encounter rate.', 'Traps STEEL-type POKMON.', 'Prevents Steel-type Pokmon from escaping.', 'Prevents Steel-type Pokmon from escaping using its magnetic force.', NULL, '5,8,17');
INSERT INTO abilities
VALUES
	(43, 'soundproof', 3, 'This Pokmon is immune to moves flagged as being sound-based.<br>The move heal-bell is unaffected. The move uproar still prevents this Pokmon from sleeping. This Pokmon can still receive a Perish Song counter through baton-pass, and will retain a Perish Song counter if it acquires this ability after Perish Song is used.<br>The moves howl, roar-of-time, sonic-boom and yawn are not flagged as sound-based.', 'Avoids sound-based moves.', 'Gives full immunity to all sound-based moves.', 'Soundproofing of the Pokmon itself gives full immunity to all sound-based moves.', NULL, '5,8,17');
INSERT INTO abilities
VALUES
	(44, 'rain dish', 3, 'This Pokmon heals for 1/16 of its maximum HP after each turn during rain.', 'Slight HP recovery in rain.', 'The Pokmon gradually recovers HP in rain.', 'The Pokmon gradually regains HP in rain.', NULL, '5,8,17');
INSERT INTO abilities
VALUES
	(45, 'sand stream', 3, 'The weather changes to a sandstorm when this Pokmon enters battle and does not end unless cancelled by another weather condition.<br>If multiple Pokmon with this ability, drizzle},drought or snow-warning are sent out at the same time, the abilities will activate in order of Speed, respecting trick-room. Each ability''s weather will cancel the previous weather, and only the weather summoned by the slowest of the Pokmon will stay.<br>Overworld: If the lead Pokmon has this ability, the wild encounter rate is halved in a sandstorm.', 'Summons a sandstorm.', 'The Pokmon summons a sandstorm in battle.', 'The Pokmon summons a sandstorm when it enters a battle.', NULL, '5,8,17');
INSERT INTO abilities
VALUES
	(46, 'pressure', 3, 'Moves targetting this Pokmon use one extra PP.<br>This ability stacks if multiple targets have it. This ability still affects moves that fail or miss. This ability does not affect ally moves that target either the entire field or just its side, nor this Pokmon''s self-targetted moves; it does, however, affect single-targetted ally moves aimed at this Pokmon, ally moves that target all other Pokmon, and opponents'' moves that target the entire field. If this ability raises a move''s PP cost above its remaining PP, it will use all remaining PP.<br>When this Pokmon enters battle, all participating trainers are notified that it has this ability.<br>Overworld: If the lead Pokmon has this ability, higher-levelled Pokmon have their encounter rate increased.', 'Raises foe''s PP usage.', 'The Pokmon raises the foe''s PP usage.', 'The Pokmon raises opposing Pokmon''s PP usage.', 'By putting pressure on the opposing Pokmon, it raises their PP usage.', '5,8,15,17');
INSERT INTO abilities
VALUES
	(47, 'thick fat', 3, 'This Pokmon takes half as much damage from fire and ice-type moves.', 'Heat-and-cold protection.', 'Raises resistance to Fire-and Ice-type moves.', 'Boosts resistance to Fire-and Ice-type moves.', 'The Pokmon is protected by a layer of thick fat, which halves the damage taken from Fire- and Ice-type moves.', '5,8,15,17');
INSERT INTO abilities
VALUES
	(48, 'early bird', 3, 'This Pokmon''s remaining sleep turn count falls by 2 rather than 1.<br>If this Pokmon''s sleep counter is at 1, it will fall to 0 and then the Pokmon will wake up.', 'Awakens quickly from sleep.', 'The Pokmon awakens quickly from sleep.', 'The Pokmon awakens twice as fast as other Pokmon from sleep.', NULL, '5,8,17');
INSERT INTO abilities
VALUES
	(49, 'flame body', 3, 'Whenever a move makes contact with this Pokmon, the move''s user has a 30% chance of being burned.<br>Overworld: If any Pokmon in the party has this ability, each egg in the party has its hatch counter decreased by 2 (rather than 1) each step cycle, making eggs hatch roughly twice as quickly. This effect does not stack if multiple Pokmon have this ability or magma-armor.', 'Burns the foe on contact.', 'Contact with the Pokmon may burn the foe.', 'Contact with the Pokmon may burn the attacker.', NULL, '5,8,11');
INSERT INTO abilities
VALUES
	(50, 'run away', 3, 'This Pokmon is always successful fleeing from wild battles, even if trapped by a move or ability.', 'Makes escaping easier.', 'Enables sure getaway from wild Pokmon.', NULL, NULL, '5,8');
INSERT INTO abilities
VALUES
	(51, 'keen eye', 3, 'This Pokmon cannot have its accuracy lowered.<br>This ability does not prevent any accuracy losses other than stat modifiers, such as the accuracy cut from fog; nor does it prevent other Pokmon''s evasion from making this Pokmon''s moves less accurate. This Pokmon can still be passed negative accuracy modifiers through heart-swap.<br>Overworld: If the first Pokmon in the party has this ability, any random encounter with a Pokmon five or more levels lower than it has a 50% chance of being skipped.', 'Prevents loss of accuracy.', 'Prevents the Pokmon from losing accuracy.', 'Prevents other Pokmon from lowering accuracy.', 'Keen eyes prevent other Pokmon from lowering this Pokmon''s accuracy.', '5,8,11,17');
INSERT INTO abilities
VALUES
	(52, 'hyper cutter', 3, 'This Pokmon''s Attack cannot be lowered by other Pokmon.<br>This ability does not prevent any Attack losses other than stat modifiers, such as the Attack cut from a burn. This Pokmon can still be passed negative Attack modifiers through heart-swap or power-swap.', 'Prevents ATTACK reduction.', 'Prevents the Attack stat from being lowered.', 'Prevents other Pokmon from lowering Attack stat.', 'The Pokmon''s proud of its powerful pincers. They prevent other Pokmon from lowering its Attack stat.', '5,8,11,17');
INSERT INTO abilities
VALUES
	(53, 'pickup', 3, 'At the end of each turn, if another Pokmon consumed or Flung a held item that turn, this Pokmon picks up the item if it is not already holding one. After each battle, this Pokmon has a 10% chance of picking up an item if it is not already holding one.<br>The Air-balloon and Eject-button cannot be picked up.<bt>The items that may be found vary by game, and, since Pokmon Emerald, by the Pokmon''s level. This ability is checked after the battle ends, at which point any temporary ability changes have worn off.', 'May pick up items.', 'The Pokmon may pick up items.', 'The Pokmon may pick up the item an opposing Pokmon used during a battle. It may pick up items outside of battle, too.', NULL, '5,8,17');
INSERT INTO abilities
VALUES
	(54, 'truant', 3, 'Every second turn on which this Pokmon should attempt to use a move, it will instead do nothing ("loaf around").<br>Loafing around interrupts moves that take multiple turns the same way paralysis, flinching, etc do. Most such moves, for example bide orrollout, are simply cut off upon loafing around. Attacks with a recharge turn, such as hyper-beam, do not have to recharge; attacks with a preparation turn, such as fly, do not end up being used. Moves that are forced over multiple turns and keep going through failure, such as outrage, uproar, or any move forced by encore, keep going as usual.<br>If this Pokmon is confused, its confusion is not checked when loafing around; the Pokmon cannot hurt itself, and its confusion does not end or come closer to ending.<br>If this Pokmon attempts to move but fails, e.g. because of paralysis or gravity, it still counts as having moved and will loaf around the next turn. If it does not attempt to move, e.g. because it is asleep or frozen, whatever it would have done will be postponed until its next attempt; that is, it will either loaf around or move as usual, depending on what it last did.<br>This ability cannot be changed with worry-seed, but it can be disabled with gastro-acid, changed with role-play, or traded away with skill-swap.', 'Moves only every two turns.', 'The Pokmon can''t attack on consecutive turns.', 'The Pokmon can''t use a move the following turn if it uses one.', NULL, '5,8,17');
INSERT INTO abilities
VALUES
	(55, 'hustle', 3, 'This Pokmon''s physical moves do 1.5 as much regular damage, but have 0.8 their usual accuracy.<br>Special moves are unaffected. Moves that do set damage, such as seismic-toss, have their accuracy affected, but not their damage.<br>Overworld: If the lead Pokmon has this ability, higher-levelled Pokmon have their encounter rate increased.', 'Trades accuracy for power.', 'Boosts the Attack stat, but lowers accuracy.', NULL, NULL, '5,8');
INSERT INTO abilities
VALUES
	(56, 'cute charm', 3, 'Whenever a move makes contact with this Pokmon, the move''s user has a 30% chance of being infatuated.<br>Overworld: If the first Pokmon in the party has this ability, any wild Pokmon whose species can be either gender has a 2/3 chance of being set to the opposite gender, and a 1/3 chance of having a random gender as usual.', 'Infatuates on contact.', 'Contact with the Pokmon may cause infatuation.', NULL, NULL, '5,8');
INSERT INTO abilities
VALUES
	(57, 'plus', 3, 'This Pokmon has 1.5 its Special Attack if any friendly Pokmon has plus or minus.<br>This bonus does not count as a stat modifier. If either ability is disabled by gastro-acid, both lose their effect.', 'Powers up with MINUS.', 'Boosts Sp. Atk if another Pokmon has Minus.', 'Ups Sp. Atk if another Pokmon has Plus or Minus.', 'Boosts the Sp. Atk stat of the Pokmon if an ally with the Plus or Minus Ability is also in battle.', '5,8,11,17');
INSERT INTO abilities
VALUES
	(58, 'minus', 3, 'This Pokmon has 1.5 its Special Attack if any friendly Pokmon has plus or minus}.<br>This bonus does not count as a stat modifier. If either ability is disabled by gastro-acid, both lose their effect.', 'Powers up with PLUS.', 'Boosts Sp. Atk if another Pokmon has Plus.', 'Ups Sp. Atk if another Pokmon has Plus or Minus.', 'Boosts the Sp. Atk stat of the Pokmon if an ally with the Plus or Minus Ability is also in battle.', '5,8,11,17');
INSERT INTO abilities
VALUES
	(59, 'forecast', 3, 'During rain, strong sunlight or hail, this Pokmon''s type changes to water, fire or ice, respectively, and its form changes to match.<br>This ability has no effect for any Pokmon other than Castform.<br>If the weather ends or becomes anything that does not trigger this ability, or a Pokmon with air-lock or cloud-nine} enters battle, this Pokmon''s type and form revert to their default. If this ability is lost or disabled, this Pokmon cannot change its current type and form until it regains its ability.', 'Changes with the weather.', 'CASTFORM transforms with the weather.', 'The Pokmon transforms with the weather to change its type to Water, Fire, or Ice.', NULL, '5,8,17');
INSERT INTO abilities
VALUES
	(60, 'sticky-hold', 3, 'This Pokmon''s hold item cannot be removed by other Pokmon.<br>Damaging moves that would remove this Pokmon''s item can still inflict damage against this Pokmon, e.g. knock-off or pluck. This Pokmon can still use moves that involve the loss of its own item, e.g. fling or trick.<br>Overworld: If the lead Pokmon has this ability, the encounter rate while fishing is increased.', 'Prevents item theft.', 'Protects the Pokmon from item theft.', 'Items held by the Pokmon are stuck fast and cannot be removed by other Pokmon.', NULL, '5,8,17');
INSERT INTO abilities
VALUES
	(61, 'shed skin', 3, 'After each turn, this Pokmon has a 33% of being cured of any major status ailment.', 'Heals the body by shedding.', 'The Pokmon may heal its own status problems.', 'The Pokmon may heal its own status conditions by shedding its skin.', NULL, '5,8,17');
INSERT INTO abilities
VALUES
	(62, 'guts', 3, 'Whenever this Pokmon is asleep, burned, paralyzed or poisoned it has 1.5 its Attack.  This Pokmon is not affected by the usual Attack cut from a burn.<br>This bonus does not count as a stat modifier.', 'Ups ATTACK if suffering.', 'Boosts Attack if there is a status problem.', 'Boosts the Attack stat if the Pokmon has a status condition.', 'It''s so gutsy that having a status condition boosts the Pokmon''s Attack stat.', '5,8,15,17');
INSERT INTO abilities
VALUES
	(63, 'marvelscale', 3, 'Whenever this Pokmon has a major status ailment, it has 1.5 its Defense.<br>This bonus does not count as a stat modifier.', 'Ups DEFENSE if suffering.', 'Boosts Defense if there is a status problem.', 'Boosts the Defense stat if the Pokmon has a status condition.', 'The Pokmon''s marvelous scales boost the Defense stat if it has a status condition.', '5,8,15,17');
INSERT INTO abilities
VALUES
	(64, 'liquid ooze', 3, 'Whenever a Pokmon would heal after hitting this Pokmon with a leeching move like absorb, it instead loses as many HP as it would usually gain.<br>The move dream-eater is unaffected.', 'Draining causes injury.', 'Inflicts damage on foes using any draining move.', 'Damages attackers using any draining move.', 'Oozed liquid has strong stench, which damages attackers using any draining move.', '5,8,15,17');
INSERT INTO abilities
VALUES
	(65, 'overgrow', 3, 'When this Pokmon has 1/3 or less of its HP remaining, its grass-type moves inflict 1.5 as much regular damage.', 'Ups GRASS moves in a pinch.', 'Powers up Grass-type moves in a pinch.', 'Powers up Grass-type moves when the Pokmon is in trouble.', 'Powers up Grass-type moves when the Pokmon''s HP is low.', '5,8,15,17');
INSERT INTO abilities
VALUES
	(66, 'blaze', 3, 'When this Pokmon has 1/3 or less of its HP remaining, its fire-type moves inflict 1.5 as much regular damage.', 'Ups FIRE moves in a pinch.', 'Powers up Fire-type moves in a pinch.', 'Powers up Fire-type moves when the Pokmon is in trouble.', 'Powers up Fire-type moves when the Pokmon''s HP is low.', '5,8,15,17');
