	(67, 'torrent', 3, 'When this Pokmon has 1/3 or less of its HP remaining, its water-type moves inflict 1.5 as much regular damage.', 'Ups WATER moves in a pinch.', 'Powers up Water-type moves in a pinch.', 'Powers up Water-type moves when the Pokmon is in trouble.', 'Powers up Water-type moves when the Pokmon''s HP is low.', '5,8,15,17');
