	(68, 'swarm', 3, 'When this Pokmon has 1/3 or less of its HP remaining, its bug-type moves inflict 1.5 as much regular damage.<br>Overworld: If the lead Pokmon has this ability, the wild encounter rate is increased.', 'Ups BUG moves in a pinch.', 'Powers up Bug-type moves in a pinch.', 'Powers up Bug-type moves when the Pokmon is in trouble.', 'Powers up Bug-type moves when the Pokmon''s HP is low.', '5,8,15,17');
INSERT INTO abilities
VALUES
	(69, 'rock head', 3, 'This Pokmon does not receive recoil damage from its recoil moves.<br>The move struggle''s recoil is unaffected.  This ability does not prevent crash damage from missing with jump-kick or high-jump-kick.', 'Prevents recoil damage.', 'Protects the Pokmon from recoil damage.', NULL, NULL, '5,8');
INSERT INTO abilities
VALUES
	(70, 'drought', 3, 'The weather changes to strong sunlight when this Pokmon enters battle and does not end unless cancelled by another weather condition.<br>If multiple Pokmon with this ability,drizzle, sand-stream or snow-warning are sent out at the same time, the abilities will activate in order of Speed, respecting trick-room. Each ability''s weather will cancel the previous weather, and only the weather summoned by the slowest of the Pokmon will stay.', 'Summons sunlight in battle.', 'The Pokmon makes it sunny if it is in battle.', 'Turns the sunlight harsh if it is in battle.', 'Turns the sunlight harsh when the Pokmon enters a battle.', '5,8,11,15');
INSERT INTO abilities
VALUES
	(71, 'arena trap', 3, 'While this Pokmon is in battle, opposing Pokmon cannot flee or switch out.  Flying-type Pokmon and Pokmon in the air, e.g. due to levitate or magnet-rise are unaffected.<br>Pokmon with run-away can still flee.  Pokmon can still switch out with the use of a move or item.<br>Overworld: If the lead Pokmon has this ability, the wild encounter rate is doubled.', 'Prevents fleeing.', 'Prevents the foe from fleeing.', 'Prevents opposing Pokmon from fleeing.', NULL, '5,8,15');
