	(72, 'vital spirit', 3, 'This Pokmon cannot be asleep.<br>This causes rest to fail altogether.  If a Pokmon is asleep and acquires this ability, it will immediately wake up; this includes when regaining a lost ability upon leaving battle.<br>This ability functions identically to insomnia in battle.<br>Overworld: If the lead Pokmon has this ability, higher-levelled Pokmon have their encounter rate increased.', 'Prevents sleep.', 'Prevents the Pokmon
INSERT INTO abilities
VALUES
	(73, 'white smoke', 3, 'This Pokmon cannot have its stats lowered by other Pokmon.<br>This ability does not prevent any stat losses other than stat modifiers, such as the Speed cut from paralysis; nor self-inflicted stat drops, such as the Special Attack drop from overheat; nor opponent-triggered stat boosts, such as the Attack boost from swagger.  This Pokmon can still be passed negative stat modifiers through guard-swap, heart-swap, or power-swap.<br>This ability functions identically to clear-body in battle.<br>Overworld: If the lead Pokmon has this ability, the wild encounter rate is halved.', 'Prevents ability reduction.', 'Prevents the Pokmon''s stats from being lowered.', 'The Pokmon is protected by its white smoke, which prevents other Pokmon from lowering its stats.', NULL, '5,8,17');
