	(76, 'air lock', 3, 'While this Pokmon is in battle, weather can still be in play, but will not have any of its effects.<br>This ability functions identically to cloud-nine.', 'Negates weather effects.', 'Eliminates the effects of weather.', NULL, NULL, '5,8');
