	(78, 'motor drive', 4, 'Whenever an electric-type move hits this Pokmon, its Speed rises one stage, negating any other effect on it.<br>This ability will not take effect if this Pokmon is immune to Electric moves.  Electric moves will ignore this Pokmon''s substitute.<br>This effect includes non-damaging moves, i.e. thunder-wave.', 'Raises Speed if hit by an Electric-type move.', 'Boosts the Speed stat when it''s hit by an Electric-type move.', 'Boosts its Speed stat if hit by an Electric-type move, instead of taking damage.', NULL, '8,15,17');
