	(80, 'steadfast', 4, 'Whenever this Pokmon flinches, its Speed rises one stage.', 'Raises Speed each time the Pokmon flinches.', 'Boosts the Speed stat each time the Pokmon flinches.', 'The Pokmon''s determination boosts the Speed stat each time the Pokmon flinches.', NULL, '8,15,17');
INSERT INTO abilities
