	(81, 'snow cloak', 4, 'During hail, this Pokmon has 1.25 its evasion, and it does not take hail damage regardless of type.<br>The evasion bonus does not count as a stat modifier.<br>Overworld: If the lead Pokmon has this ability, the wild encounter rate is halved in snow.', 'Raises evasion in a hailstorm.', 'Boosts evasion in a hailstorm.', NULL, NULL, '8,15');
INSERT INTO abilities
VALUES
	(82, 'gluttony', 4, 'This Pokmon eats any held Berry triggered by low HP when it falls below 50% of its HP, regardless of the Berry''s usual threshold.', 'Encourages the early use of a held Berry.', 'Makes the Pokmon use a held Berry earlier than usual.', 'Makes the Pokmon eat a held Berry when its HP drops to half or less, which is sooner than usual.', NULL, '8,15,17');
INSERT INTO abilities
VALUES
	(83, 'anger point', 4, 'Whenever this Pokmon receives a critical hit, its Attack rises to the maximum of 6 stages.<br>This ability will still take effect if the critical hit is received by a substitute.', 'Raises Attack upon taking a critical hit.', 'Maxes Attack after taking a critical hit.', 'Maxes the Attack stat after the Pokmon takes a critical hit.', 'The Pokmon is angered when it takes a critical hit, and that maxes its Attack stat.', '8,11,15,17');
INSERT INTO abilities
VALUES
	(84, 'unburden', 4, 'When this Pokmon uses or loses its held item, its Speed is doubled.  If it gains another item or leaves battle, this bonus is lost.<br>This includes when the Pokmon drops its item because of knock-off.  This bonus does not count as a stat modifier.  There is no notification when this ability takes effect.', 'Raises Speed if a held item is used.', 'Boosts the Speed stat if its held item is used or lost.', 'Boosts the Speed stat if the Pokmon''s held item is  used or lost.', NULL, '8,15,17');
INSERT INTO abilities
VALUES
	(85, 'heatproof', 4, 'This Pokmon takes half as much damage from fire-type moves and burns.', 'Weakens the power of Fire-type moves.', 'The heatproof body of the Pokmon halves the damage from Fire-type moves that hit it.', NULL, NULL, '8,17');
INSERT INTO abilities
VALUES
	(86, 'simple', 4, 'Each stage of this Pokmon''s stat modifiers acts as two stages.  These doubled stages are still limited to a minimum of -6 and a maximum of 6.<br>This Pokmon can still accumulate less than -3 or more than 3 stages of stat modifiers, even though the extra ones have no effect after doubling.', 'The Pokmon is prone to wild stat changes.', 'The stat changes the Pokmon receives are doubled.', NULL, NULL, '8,17');
INSERT INTO abilities
VALUES
	(87, 'dry skin', 4, 'This Pokmon takes 1/8 of its maximum HP in damage after each turn during strong sunlight, but it heals for 1/8 of its HP each turn during rain.  This Pokmon takes 1.25 as much damage from firetype moves, but whenever a water move hits it, it heals for 1/4 its maximum HP instead.', 'Reduces HP if it is hot. Water restores HP.', 'Restores HP in rain or when hit by Water-type moves. Reduces HP in sunshine, and increases the damage received from Fire-type moves.', NULL, NULL, '8,17');
INSERT INTO abilities
VALUES
	(88, 'download', 4, 'When this Pokmon enters battle, its Attack or Special Attack, whichever corresponds to its opponents'' weaker total defensive stat, rises one stage.  In the event of a tie, Special Attack is raised.<br>This ability also takes effect when acquired during a battle.', 'Adjusts power according to the foe''s ability.', 'Adjusts power according to a foe''s defenses.', 'Adjusts power based on an opposing Pokmon''s stats.', 'Compares an opposing Pokmon''s Defense and Sp. Def stats before raising its own Attack or Sp. Atk statwhichever will be more effective.', '8,11,15,17');
INSERT INTO abilities
VALUES
	(89, 'iron fist', 4, 'Moves flagged as being punch-based have 1.2 their base power for this Pokmon.<br>The move sucker-punch is not flagged as punch-based; its original, Japanese name only means ''surprise attack''.', 'Boosts the power of punching moves.', 'Powers up punching moves.', NULL, NULL, '8,15');
INSERT INTO abilities
VALUES
	(90, 'poison heal', 4, 'If this Pokmon is poisoned, it will heal for 1/8 of its maximum HP after each turn rather than taking damage.  This includes bad poison.', 'Restores HP if the Pokmon is poisoned.', 'Restores HP if the Pokmon is poisoned, instead of losing HP.', NULL, NULL, '8,17');
INSERT INTO abilities
VALUES
	(91, 'adaptability', 4, 'This Pokmon inflicts twice as much damage with moves whose types match its own, rather than the usual same-type attack bonus of 1.5.', 'Powers up moves of the same type.', 'Powers up moves of the same type as the Pokmon.', NULL, NULL, '8,15');
INSERT INTO abilities
VALUES
	(92, 'skill link', 4, 'This Pokmon always hits five times with two-to-five-hit moves, such as icicle-spear.  It also bypasses the accuracy checks on triple-kick''s second and third hits.', 'Increases the frequency of multi-strike moves.', 'Increases the number of times multi-strike moves hit.', 'Maximizes the number of times multi-strike moves hit.', NULL, '8,15,17');
INSERT INTO abilities
VALUES
	(93, 'hydration', 4, 'This Pokmon is cured of any major status ailment after each turn during rain.', 'Heals status problems if it is raining.', 'Heals status conditions if it''s raining.', NULL, NULL, '8,15');
INSERT INTO abilities
VALUES
	(94, 'solar power', 4, 'During strong sunlight, this Pokmon has 1.5 its Special Attack but takes 1/8 of its maximum HP in damage after each turn.', 'Boosts Sp. Atk, but lowers HP in sunshine.', 'In sunshine, Sp. Atk is boosted but HP decreases.', 'Boosts the Sp. Atk stat in sunny weather, but HP decreases.', 'Boosts the Sp. Atk stat in harsh sunlight, but HP decreases every turn.', '8,11,15,17');
INSERT INTO abilities
VALUES
	(95, 'quick feet', 4, 'Whenever this Pokmon has a major status ailment, it has 1.5 its Speed.  This Pokmon is not affected by the usual Speed cut from paralysis.<br>Overworld: If the lead Pokmon has this ability, the wild encounter rate is halved.', 'Boosts Speed if there is a status problem.', 'Boosts the Speed stat if the Pokmon has a status condition.', NULL, NULL, '8,15');
INSERT INTO abilities
VALUES
	(96, 'normalize', 4, 'This Pokmon''s moves all act as if they were normal-type.<br>Moves that inflict typeless damage do so as usual.  Moves of variable type, such as hidden-power, are affected.  They otherwise work as usual, however; weather-ball, for example, is always forced to be Normal, but it still has doubled power and looks different during weather.<br>As is prevented by immunities, unlike most non-damaging moves, it does not affect ghost-type Pokmon under the effect of this ability.', 'All the Pokmon''s moves become the Normal type.', 'All the Pokmon''s moves become Normal type. The power of those moves is boosted a little.', NULL, NULL, '8,17');
INSERT INTO abilities
VALUES
	(97, 'sniper', 4, 'This Pokmon inflicts triple damage with critical hits, rather than the usual double damage.', 'Powers up moves if they become critical hits.', 'Powers up moves if they become critical hits when attacking.', NULL, NULL, '8,17');
INSERT INTO abilities
VALUES
	(225, 'rks system', 7, 'Changes this Pokmon''s type to match its held Memory.<br>This ability cannot be copied, replaced, or nullified.  This ability only takes effect for Silvally.', 'Changes the Pokmon''s type to match the memory disc it holds.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(98, 'magic guard', 4, 'This Pokmon is immune to damage not directly caused by a move.<br>For example, this Pokmon takes no damage from from weather, recoil, status ailments or spikes, but it still suffers from the Attack cut when burned, and a life-orb will still power up this Pokmon''s moves without damaging it.  Anything that directly depends on such damage will also not happen; for example, leech-seed will neither hurt this Pokmon nor heal the opponent, and Pokmon with a jaboca-berry or rowap-berry will not consume the berry when hit by this Pokmon.<br>The following are unaffected: struggle, pain-split (whether used by or against this Pokmon), belly-drum, substitute, curse, moves that knock the user out, and damage from confusion.<br>This Pokmon will neither lose nor regain HP if it drains HP from a Pokmon with liquid-ooze.<br>If this Pokmon is badly poisone, the poison counter is still increased each turn; if the Pokmon loses this ability, it will begin taking as much damage as it would be if it had been taking increasing damage each turn.', 'The Pokmon only takes damage from attacks.', NULL, NULL, NULL, '8');
INSERT INTO abilities
VALUES
	(99, 'no guard', 4, 'Moves used by or against this Pokmon never miss.<br>One-hit KO moves are unaffected.  Moves affected by this ability can hit Pokmon during the preparation turn of moves like dig or fly.<br>Overworld: If the lead Pokmon has this ability, the wild encounter rate is doubled.', 'Ensures the Pokmon and its foe''s attacks land.', 'Ensures attacks by or against the Pokmon land.', 'The Pokmon employs no-guard tactics to ensure incoming and outgoing attacks always land.', NULL, '8,11,17');
INSERT INTO abilities
VALUES
	(100, 'stall', 4, 'This Pokmon moves last within its priority bracket.<br>Multiple Pokmon with this ability move in order of Speed amongst themselves.<br>The full-incense and lagging-tail take precedence over this ability; that is, Pokmon with these items move after Pokmon with this ability.  Pokmon with both this ability and one of these items are delayed as much as if they had only the item.<br>This ability works as usual during trick-room: Pokmon with this ability will move in reverse order of Speed after Pokmon without it.', 'The Pokmon moves after even slower foes.', 'The Pokmon moves after all other Pokmon do.', NULL, NULL, '8,11');
INSERT INTO abilities
VALUES
	(101, 'technician', 4, 'This Pokmon''s moves have 1.5 their power if their base power is 60 or less.<br>This includes moves of variable power, such as hidden-power and magnitude, when their power is 60 or less. The move helping-hand''s power boost is taken into account for any move, as is defense-curl''s power boost for rollout.', 'Powers up the Pokmon''s weaker moves.', NULL, NULL, NULL, '8');
INSERT INTO abilities
VALUES
	(102, 'leaf guard', 4, 'This Pokmon cannot be given a major status ailment during strong sunlight.<br>This ability does not heal prior status ailments.  The move rest} will fail altogether with this ability in effect. The move yawn will immediately fail if used on this Pokmon during strong sunlight, and an already-used Yawn will fail if the weather turns to strong sunlight in the meantime.', 'Prevents status problems in sunny weather.', 'Prevents problems with status in sunny weather.', 'Prevents status conditions in harsh sunlight.', NULL, '8,11,18');
INSERT INTO abilities
VALUES
	(103, 'klutz', 4, 'In battle, this Pokmon cannot use its held item, nor will the item have any passive effect on the battle, positive or negative.  This Pokmon also cannot use fling.<br>The Speed cut from the iron-ball and the effort items (the macho-brace, power-weight, power-bracer, item:power-belt, power-lens, power-band, and power-anklet) is unaffected.  Items that do not directly affect the battle, such as the exp-share, the amulet-coin, or the soothe-bell, work as usual.  All held items work as usual out of battle.<br>Other moves that use the held item, such as natural-gift and switcheroo work as usual.', 'The Pokmon can''t use any held items.', NULL, NULL, NULL, '8');
INSERT INTO abilities
VALUES
	(104, 'mold breaker', 4, 'This Pokmon''s moves completely ignore abilities that could hinder or prevent their effect on the target.<br>For example, this Pokmon''s moves ignore abilities that would fully negate them, such as water-absorb; abilities that would prevent any of their effects, such as clear-body, shell-armor, or sticky-hold; and abilities that grant any general protective benefit, such as simple, snow-cloak, or thick-fat.  If an ability could either hinder or help this Pokmon''s moves, e.g. dry-skin or unaware, the ability is ignored either way.<br>Abilities that do not fit this description, even if they could hinder moves in some other way, are not affected.  For example, cursed-body only affects potential future uses of the move, while liquid-ooze and shadow-tag can only hinder a move''s effect on the user.  This ablity cannot ignore type or form changes granted by abilities, for example color-change or forecast; nor effects that were caused by abilities but are no longer tied to an ability, such as the rain from drizzle.  This ability cannot ignore multitype at all.<br>An ability ignored by this ability is only nullified while the move is being used.  For example, this Pokmon''s moves can paralyzeparalysis a Pokmon with Limber, but Limber will activate and heal the paralysis immediately thereafter, and this Pokmon''s spikes are not affected by this ability after they have been placed.<br>When this Pokmon enters battle, all participating trainers are notified that it has this ability.<br>This ability functions identically to teravolt and turboblaze.', 'Moves can be used regardless of abilities.', NULL, NULL, NULL, '8');
INSERT INTO abilities
VALUES
	(105, 'super luck', 4, 'This Pokmon''s moves have critical hit rates one stage higher than normal.', 'Heightens the critical-hit ratios of moves.', 'Boosts the critical-hit ratios of moves.', 'The Pokmon is so lucky that the critical-hit ratios of its moves are boosted.', NULL, '8,15,17');
INSERT INTO abilities
VALUES
	(106, 'aftermath', 4, 'When this Pokmon is knocked out by a move that makes contact, the move''s user takes 1/4 its maximum HP in damage.', 'Damages the foe landing
INSERT INTO abilities
VALUES
	(107, 'anticipation', 4, 'When this Pokmon enters battle, if one of its opponents has a move that is super effective against it, self-destruct, explosion, or a one-hit knockout move, all participating trainers are notified.<br>The move itself is not revealed; only that there is such a move.  Moves that inflict typeless damagee, such as future-sight, and moves of variable type, such as hidden-power, count as their listed types. The moves counter, metal-burst, mirror-coat, and one-hit KO moves to which this Pokmon is immune do not trigger this ability.', 'Senses the foe''s dangerous moves.', 'Senses an opposing Pokmon''s dangerous moves.', 'The Pokmon can sense an opposing Pokmon''s dangerous moves.', NULL, '8,15,17');
INSERT INTO abilities
VALUES
	(108, 'forewarn', 4, 'When this Pokmon enters battle, it reveals the move with the highest base power known by any opposing Pokmon to all participating trainers.<br>In the event of a tie, one is chosen at random.', 'Determines what moves the foe has.', 'Determines what moves an opposing Pokmon has.', 'When it enters a battle, the Pokmon can tell one of the moves an opposing Pokmon has.', NULL, '8,15,17');
INSERT INTO abilities
VALUES
	(226, 'electric surge', 7, 'When this Pokmon enters battle, it changes the terrain to electric-terrain.', 'Turns the ground into Electric Terrain when the Pokmon enters a battle.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(227, 'psychic surge', 7, 'When this Pokmon enters battle, it changes the terrain to psychic-terrain.', 'Turns the ground into Psychic Terrain when the Pokmon enters a battle.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(109, 'unaware', 4, 'This Pokmon ignores other Pokmon''s stat modifiers for the purposes of damage and accuracy calculation.<br>Effectively, this affects modifiers of every stat except Speed.<br>The power of punishment and stored-power is calculated as usual.  When this Pokmon hurts itself in confusion, its stat modifiers affect damage as usual.', 'Ignores any change in ability by the foe.', 'Ignores any stat changes in the Pokmon.', 'Ignores the opposing Pokmon''s stat changes.', 'When attacking, the Pokmon ignores the target Pokmon''s stat changes.', '8,11,15,17');
INSERT INTO abilities
VALUES
	(110, 'tinted lens', 4, 'This Pokmon deals twice as much damage with moves that are not very effective against the target.', 'Powers up not very effective moves.', 'The Pokmon can use not very effective moves to deal regular damage. ', NULL, NULL, '8,17');
INSERT INTO abilities
VALUES
	(111, 'filter', 4, 'This Pokmon takes 0.75 as much damage from moves that are super effective against it.<br>This ability functions identically to Solid-rock.', 'Powers down super effective moves.', 'Reduces damage from supereffective attacks.', 'Reduces the power of supereffective attacks taken.', NULL, '8,10,17');
INSERT INTO abilities
VALUES
	(112, 'slow start', 4, 'This Pokmon''s Attack and Speed are halved for five turns upon entering battle.<br>This ability also takes effect when acquired during battle.  If this Pokmon loses its ability before the five turns are up, its Attack and Speed return to normal; if it then regains this ability without leaving battle, its Attack and Speed are halved again, but the counter keeps counting from where it was.', 'Temporarily halves Attack and Speed.', 'Temporarily halves the Pokmon''s Attack and Speed stats.', 'For five turns, the Pokmon''s Attack and Speed stats are halved.', NULL, '8,15,17');
INSERT INTO abilities
VALUES
	(113, 'scrappy', 4, 'This Pokmon ignores ghost-type Pokmon''s immunity to type:normal and fighting-type moves.<br>Ghost Pokmon''s other types affect damage as usual.', 'Enables moves to hit Ghost-type foes.', 'Makes Normal- and Fighting-type moves hit Ghost-type Pokmon.', 'The Pokmon can hit Ghost-type Pokmon with Normal- and Fighting-type moves.', NULL, '8,15,17');
INSERT INTO abilities
VALUES
	(114, 'storm drain', 4, 'All other Pokmon''s single-target water-type moves are redirected to this Pokmon, if it is an eligible target.  Other Pokmon''s Water moves raise this Pokmon''s Special Attack one stage, negating any other effect on it, and cannot miss it.<br>If the move''s intended target also has this ability, the move is not redirected.  When multiple Pokmon with this ability are possible targets for redirection, the move is redirected to the one with the highest Speed stat, or, in the case of a tie, to a random tied Pokmon. The move follow-me takes precedence over this ability.', 'The Pokmon draws in all Water-type moves.', 'Draws in all Water-type moves to up Sp. Attack.', 'Draws in all Water-type moves. Instead of being hit  by Water-type moves, it boosts its Sp. Atk.', NULL, '8,11,17');
INSERT INTO abilities
VALUES
	(115, 'ice body', 4, 'This Pokmon heals for 1/16 of its maximum HP after each turn during hail, and it does not take hail damage regardless of type.', 'The Pokmon regains HP in a hailstorm.', 'The Pokmon gradually regains HP in a hailstorm.', NULL, NULL, '8,11');
INSERT INTO abilities
VALUES
	(116, 'solid rock', 4, 'This Pokmon takes 0.75 as much damage from moves that are super effective against it.<br>This ability functions identically to Filter.', 'Powers down super effective moves.', 'Reduces damage from supereffective attacks', 'Reduces the power of supereffective attacks taken.', NULL, '8,10,17');
INSERT INTO abilities
VALUES
	(117, 'snow warning', 4, 'The weather changes to hail when this Pokmon enters battle and does not end unless cancelled by another weather condition.<br>If multiple Pokmon with this ability, drizzle, drought, or sand-stream are sent out at the same time, the abilities will activate in order of Speed, respecting trick-room.  Each ability''s weather will cancel the previous weather, and only the weather summoned by the slowest of the Pokmon will stay.', 'The Pokmon summons a hailstorm in battle.', 'The Pokmon summons a hailstorm when it enters a battle.', NULL, NULL, '8,11');
INSERT INTO abilities
VALUES
	(118, 'honey gather', 4, 'This Pokmon has a chance of picking up honey after each battle.  This chance starts at 5% and rises another 5% after every tenth level: 5% from level 110, 10% from 1120, and so on, up to 50% from 91100.<br>This ability is checked after the battle ends, at which point any temporary ability changes have worn off.', 'The Pokmon may gather Honey from somewhere.', 'The Pokmon may gather Honey after a battle.', NULL, NULL, '8,17');
INSERT INTO abilities
VALUES
	(119, 'frisk', 4, 'When this Pokmon enters battle, it reveals an opposing Pokmon''s held item to all participating trainers.<br>In a double battle, if one opponent has an item, this Pokmon will Frisk that Pokmon; if both have an item, it will Frisk one at random.', 'The Pokmon can check the foe''s held item.', 'The Pokmon can check an opposing Pokmon''s held item.', 'When it enters a battle, the Pokmon can check an opposing Pokmon''s held item.', NULL, '8,15,17');
INSERT INTO abilities
VALUES
	(120, 'reckless', 4, 'This Pokmon''s recoil moves and crash moves have 1.2 their base power.<br>The movestruggle is unaffected.<br>The ''crash moves'' are the moves that damage the user upon missing: jump-kick andhigh-jump-kick.', 'Powers up moves that have recoil damage.', NULL, NULL, NULL, '8');
INSERT INTO abilities
VALUES
	(121, 'multitype', 4, 'If this Pokmon is holding an elemental Plate, its type and form change to match the Plate.<br>This Pokmon''s held item, whether or not it is a Plate, cannot be taken by covet or thief, nor removed by knock-off, nor traded by switcheroo or trick.  Covet, Thief, and Knock Off still inflict damage against this Pokmon.  Unlike with sticky-hold, this Pokmon cannot use fling, Switcheroo, or Trick to lose its item itself, nor gain an item through Switcheroo or Trick if it does not have one.<br>This ability has no effect for any Pokmon other than Arceus.  This ability cannot be traded with skill-swap, nor copied with role-play or trace, nor disabled with gastro-acid, nor changed with worry-seed.  This Pokmon cannot use Skill Swap or Role Play to lose its ability itself.  The ability mold-breaker cannot ignore this ability.<br>If a Pokmon Transforms into an Arceus with this ability, it will Transform into Arceus''s default, normal-type form.  If the Transforming Pokmon is holding a Plate, this ability will then activate and change the Pokmon into the corresponding form.', 'Changes type to match the held Plate.', 'Changes the Pokmon''s type to match the Plate it holds.', 'Changes the Pokmon''s type to match the Plate or Z-Crystal it holds.', NULL, '8,15,17');
INSERT INTO abilities
VALUES
	(122, 'flower gift', 4, 'Friendly Pokmon have 1.5 their Attack and Special Defense during strong sunlight if any friendly Pokmon has this ability.<br>Unlike forecast, multitype, and zen-mode, this ability is not tied to its Pokmon''s form change; Cherrim will switch between its forms even if it loses this ability.  As such, this ability also works if obtained by a Pokmon other than Cherrim.', 'Powers up party Pokmon when it is sunny.', 'Boosts the Attack and Sp. Def stats of itself and allies when it is sunny.', NULL, NULL, '8,17');
INSERT INTO abilities
VALUES
	(123, 'bad dreams', 4, 'Opposing Pokmon take 1/8 of their maximum HP in damage after each turn while they are asleep.', 'Reduces a sleeping foe''s HP.', 'Reduces the HP of sleeping opposing Pokmon.', NULL, NULL, '8,15');
INSERT INTO abilities
VALUES
	(228, 'misty surge', 7, 'When this Pokmon enters battle, it changes the terrain to misty-terrain.', 'Turns the ground into Misty Terrain when the Pokmon enters a battle.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(229, 'grassy surge', 7, 'When this Pokmon enters battle, it changes the terrain to grassy-terrain.', 'Turns the ground into Grassy Terrain when the Pokmon enters a battle.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(124, 'pickpocket', 5, 'Whenever a move makes contact with this Pokmon, if it does not have a held item, it steals the attacker''s held item.<br>This Pokmon cannot steal upon being knocked out.  It can steal if the attacker has a substitute, but cannot steal when its own Substitute is hit.  If a move hits multiple times, only the last hit triggers this ability.  If this Pokmon is wild, it cannot steal from a trained Pokmon.', 'Steals an item when hit
INSERT INTO abilities
VALUES
	(125, 'sheer force', 5, 'This Pokmon''s moves with extra effects have 1.3 their power, but lose their extra effects.<br>An effect chance is a move''s chance to inflict a status ailment, cause a stat change, or make the target flinch in addition to the move''s main effect. For example, thunder-shock''s paralysis is an extra effect, but thunder-wave''s is not, nor are knock-off''s item removal and air-cutter''s increased critical hit rate.<br>Moves that lower the user''s stats are unaffected.', 'Removes added effects to increase move damage.', 'Removes additional effects to increase move damage.', 'Removes additional effects to increase the power nof moves when attacking.', NULL, '11,15,17');
INSERT INTO abilities
VALUES
	(126, 'contrary', 5, 'Whenever this Pokmon''s stats would be raised, they are instead lowered by the same amount, and vice versa.', 'Makes stat changes have an opposite effect.', NULL, NULL, NULL, '11');
INSERT INTO abilities
VALUES
	(127, 'unnerve', 5, 'Opposing Pokmon cannot eat held Berries while this Pokmon is in battle.<br>Affected Pokmon can still use bug-bite or pluck to eat a target''s Berry.', 'Makes the foe nervous and
INSERT INTO abilities
VALUES
	(128, 'defiant', 5, 'When any of this Pokmon''s stats are lowered, its Attack rises by two stages.<br>If multiple stats are lowered at once, this ability takes effect with each stat lowered.', 'When its stats are lowered
INSERT INTO abilities
VALUES
	(129, 'defeatist', 5, 'This Pokmon''s Attack and Special Attack are halved when it has half its HP or less.', 'Lowers stats when HP becomes half or less.', 'Halves the Pokmon''s Attack and Sp. Atk stats when its HP becomes half or less.', NULL, NULL, '11,17');
INSERT INTO abilities
VALUES
	(130, 'cursed body', 5, 'Moves that hit this Pokmon have a 30% chance of being Disabled afterward.', 'May disable a move used on the Pokmon.', NULL, NULL, NULL, '11');
INSERT INTO abilities
VALUES
	(131, 'healer', 5, 'Friendly Pokmon next to this Pokmon in double and triple battles each have a 30% chance of being cured of any major status ailment after each turn.', 'May heal an ally''s status conditions.', 'Sometimes heals an ally''s status condition.', NULL, NULL, '11,15');
INSERT INTO abilities
VALUES
	(132, 'friend guard', 5, 'All friendly Pokmon take 0.75 as much direct damage from moves while this Pokmon is in battle.<br>This effect stacks if multiple allied Pokmon have it.', 'Reduces damage done to allies.', NULL, NULL, NULL, '11');
INSERT INTO abilities
VALUES
	(133, 'weak armor', 5, 'Whenever a physical move hits this Pokmon, its Speed rises one stage and its Defense falls one stage.<br>This ability triggers on every hit of a multiple-hit move.', 'Physical attacks lower Defense and raise Speed.', 'Physical attacks lower its Defense stat and raise its Speed stat.', NULL, NULL, '11,15');
INSERT INTO abilities
VALUES
	(134, 'heavy metal', 5, 'This Pokmon has double the usual weight for its species.', 'Doubles the Pokmon''s weight.', NULL, NULL, NULL, '11');
INSERT INTO abilities
VALUES
	(135, 'light metal', 5, 'This Pokmon has half the usual weight for its species.', 'Halves the Pokmon''s weight.', NULL, NULL, NULL, '11');
INSERT INTO abilities
VALUES
	(136, 'multiscale', 5, 'This Pokmon takes half as much damage when it is hit having full HP.', 'Reduces damage when HP is full.', 'Reduces damage the Pokmon takes when its HP is full.', 'Reduces the amount of damage the Pokmon takes when its HP is full.', NULL, '11,15,17');
INSERT INTO abilities
VALUES
	(137, 'toxic boost', 5, 'This Pokmon has 1.5 its Attack when poisoned.', 'Powers up physical attacks when poisoned.', 'Powers up physical attacks when the Pokmon is poisoned.', NULL, NULL, '11,15');
INSERT INTO abilities
VALUES
	(138, 'flare boost', 5, 'This Pokmon has 1.5 its Special Attack when burned.', 'Powers up special attacks when burned.', 'Powers up special attacks when the Pokmon is burned.', NULL, NULL, '11,15');
INSERT INTO abilities
VALUES
	(139, 'harvest', 5, 'After each turn, if the last item this Pokmon consumed was a Berry and it is not currently holding an item, it has a 50% chance of regaining that Berry, or a 100% chance during strong sunlight.', 'May create another Berry after one is used.', NULL, NULL, NULL, '11');
INSERT INTO abilities
VALUES
	(140, 'telepathy', 5, 'This Pokmon does not take damage from friendly Pokmon''s moves, including single-target moves aimed at it.', 'Anticipates an ally''s attack and dodges it.', NULL, NULL, NULL, '11');
INSERT INTO abilities
VALUES
	(141, 'moody', 5, 'After each turn, one of this Pokmon''s stats at random rises two stages and another falls one stage.<br>If a stat is already at 6 or -6 stages, it will not be chosen to be increased or decreased, respectively.', 'Raises one stat and lowers another.', 'Raises one stat sharply and lowers another every turn.', NULL, NULL, '11,17');
INSERT INTO abilities
VALUES
	(142, 'overcoat', 5, 'This Pokmon does not take damage from weather.', 'Protects the Pokmon from damage from weather.', 'Protects the Pokmon from things like sand, hail, and powder.', NULL, NULL, '11,15');
INSERT INTO abilities
VALUES
	(143, 'poison touch', 5, 'This Pokmon''s contact moves have a 30% chance of poisoning the target with each hit.<br>This counts as an extra effect for the purposes of shield-dust.  This ability takes effect before mummy.', 'May poison targets when a Pokmon makes contact.', 'May poison a target when the Pokmon makes contact.', NULL, NULL, '11,15');
INSERT INTO abilities
VALUES
	(144, 'regenerator', 5, 'This Pokmon regains 1/3 of its maximum HP when it is switched out for another Pokmon under any circumstances other than having fainted.<br>This ability does not take effect when a battle ends.', 'Restores a little HP when withdrawn from battle.', 'Restores a little HP when withdrawn from battle.', NULL, NULL, '11,17');
INSERT INTO abilities
VALUES
	(145, 'big pecks', 5, 'This Pokmon''s Defense cannot be lowered by other Pokmon.<br>This Pokmon can still be passed negative Defense modifiers through heart-swap or guard-swap.', 'Protects the Pokmon from Defense-lowering attacks.', NULL, NULL, NULL, '11');
INSERT INTO abilities
VALUES
	(146, 'sand rush', 5, 'This Pokmon''s Speed is doubled during a sandstorm, and it does not take sandstorm damage, regardless of type.', 'Boosts the Pokmon''s Speed in a sandstorm.', 'Boosts the Pokmon''s Speed stat in a sandstorm.', NULL, NULL, '11,17');
INSERT INTO abilities
VALUES
	(147, 'wonder skin', 5, 'Non-damaging moves have exactly 50% base accuracy against this Pokmon.', 'Makes status-changing moves more likely to miss.', 'Makes status moves more likely to miss.', NULL, NULL, '11,17');
INSERT INTO abilities
VALUES
	(148, 'analytic', 5, 'This Pokmon''s moves have 1.3 their power when it moves last in a turn.<br>The moves future-sight and doom-desire are unaffected.', 'Boosts move power when the Pokmon moves last.', 'Boosts move power when the Pokmon moves after the target.', 'Boosts move power when the Pokmon moves last.', NULL, '11,15,17');
INSERT INTO abilities
VALUES
	(230, 'full metal body', 7, 'This Pokmon''s stats cannot be lowered by other Pokmon''s moves or abilities.  This effect only applies to normal stat modifications and not more exotic effects such as topsy-turvy or power-swap.<br>This Ability is not bypassed by mold-breaker, teravolt or turboblaze.', 'Prevents other Pokmon''s moves or Abilities from lowering the Pokmon''s stats.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(149, 'illusion', 5, 'This Pokmon, upon being sent out, appears to have the species, nickname, and Pok Ball of the last Pokmon in the party that is able to battle.  This illusion breaks upon being hit by a damaging move.<br>Other damage, e.g. from weather or spikes, does not break the illusion, nor does damage done to a substitute.<br>If the party order becomes temporarily shuffled around as Pokmon are switched out in battle, this ability chooses the last Pokmon according to that shuffled order.', 'Comes out disguised as the Pokmon in back.', 'Comes out disguised as the Pokmon in the party''s last spot.', NULL, NULL, '11,15');
INSERT INTO abilities
VALUES
	(150, 'imposter', 5, 'This Pokmon transforms into a random opponent upon entering battle.  This effect is identical to the move transform.', 'It transforms itself into the Pokmon it is facing.', 'The Pokmon transforms itself into the Pokmon it''s facing.', NULL, NULL, '11,15');
INSERT INTO abilities
VALUES
	(151, 'infiltrator', 5, 'This Pokmon''s moves ignore light-screen, reflect and safeguard.', 'Passes through the foe''s barrier and strikes.', 'Passes through the opposing Pokmon''s barrier and strikes.', 'Passes through the opposing Pokmon''s barrier, substitute, and the like and strikes.', NULL, '11,15,17');
INSERT INTO abilities
VALUES
	(152, 'mummy', 5, 'Whenever a contact move hits this Pokmon, the attacking Pokmon''s ability changes to Mummy.<br>[]The ability multitype is unaffected.  If a Pokmon with moxie knocks this Pokmon out, the former''s ability will change without taking effect.', 'Contact with this Pokmon spreads this Ability.', 'Contact with the Pokmon changes the attacker''s Ability to Mummy.', NULL, NULL, '11,17');
INSERT INTO abilities
VALUES
	(153, 'moxie', 5, 'This Pokmon''s Attack rises one stage upon knocking out another Pokmon, even a friendly Pokmon.<br>This ability does not take effect when the Pokmon indirectly causes another Pokmon to faint, e.g. through poison or spikes.<br>If this Pokmon knocks out a Pokmon with mummy, the former''s ability will change without taking effect.', 'Boosts Attack after knocking out any Pokmon.', 'The Pokmon shows moxie, and that boosts the Attack stat after knocking out any Pokmon.', NULL, NULL, '11,17');
INSERT INTO abilities
VALUES
	(154, 'justified', 5, 'Whenever a dark-type move hits this Pokmon, its Attack rises one stage.<br>The move is not negated in any way.', 'Raises Attack when hit by a Dark-type move.', 'Being hit by a Dark-type move boosts the Attack stat of the Pokmon, for justice.', NULL, NULL, '11,17');
INSERT INTO abilities
VALUES
	(155, 'rattled', 5, 'This Pokmon''s Speed rises one stage with each hit from a damaging dark, ghost, or bug-type move.', 'Some move types scare it and boost its Speed.', 'Dark-, Ghost-, and Bug-type moves scare the Pokmon and boost its Speed stat.', NULL, NULL, '11,17');
INSERT INTO abilities
VALUES
	(156, 'magic bounce', 5, 'When this Pokmon is targeted by a move flagged as being reflectable, the move is redirected to its user.<br>All reflectable moves are non-damaging, and most non-damaging moves that target other Pokmon are reflectable.<br>A move reflected by this ability or magic-coat cannot be reflected back.', 'Reflects status-changing moves.', 'Reflects status moves.', 'Reflects status moves, instead of getting hit by them.', NULL, '11,15,17');
INSERT INTO abilities
VALUES
	(157, 'sap sipper', 5, 'Whenever a grass-type move hits this Pokmon, its Attack rises one stage, negating any other effect on it.', 'Boosts Attack when hit by a Grass-type move.', 'Boosts the Attack stat when hit by a Grass-type move.', 'Boosts the Attack stat if hit by a Grass-type move, instead of taking damage.', NULL, '11,15,17');
INSERT INTO abilities
VALUES
	(158, 'prankster', 5, 'This Pokmon''s non-damaging moves have their priority increased by one stage.', 'Gives priority to a status move.', NULL, NULL, NULL, '11');
INSERT INTO abilities
VALUES
	(159, 'sand force', 5, 'During a sandstorm, this Pokmon''s rock, ground and steel-type moves have 1.3 their base power.  This Pokmon does not take sandstorm damage, regardless of type.', 'Boosts certain moves'' power in a sandstorm.', 'Boosts the power of Rock-, Ground-, and Steel-type moves in a sandstorm.', NULL, NULL, '11,17');
INSERT INTO abilities
VALUES
	(160, 'iron barbs', 5, 'Whenever a move makes contact with this Pokmon, the move''s user takes 1/8 of its maximum HP in damage.<br>This ability functions identically to rough-skin.', 'Inflicts damage to the Pokmon on contact.', 'Inflicts damage to the attacker on contact with iron barbs.', NULL, NULL, '11,17');
INSERT INTO abilities
VALUES
	(161, 'zen mode', 5, 'This Pokmon switches between Standard Mode and Zen Mode after each turn depending on its HP.  Below 50% of its maximum HP, it switches to Zen Mode, and at 50% or above, it switches to Standard Mode.<br>This Pokmon returns to Standard Mode upon leaving battle or losing this ability.  This ability has no effect if this Pokmon is not a Darmanitan.', 'Changes the Pokmon''s shape when HP is halved.', 'Changes the Pokmon''s shape when HP is half or less.', NULL, NULL, '11,15');
INSERT INTO abilities
VALUES
	(162, 'victory star', 5, 'All friendly Pokmon''s moves, including this Pokmon''s own moves, have 1.1 their usual accuracy while this Pokmon is in battle.', 'Boosts the accuracy of its allies and itself.', NULL, NULL, NULL, '11');
INSERT INTO abilities
VALUES
	(163, 'turboblaze', 5, 'This Pokmon''s moves completely ignore abilities that could hinder or prevent their effect on the target.<br>For example, this Pokmon''s moves ignore abilities that would fully negate them, such as water-absorb; abilities that would prevent any of their effects, such as clear-body, shell-armor or sticky-hold; and abilities that grant any general protective benefit, such as simple, snow-cloak, or thick-fat.  If an ability could either hinder or help this Pokmon''s moves, e.g. dry-skin or unaware, the ability is ignored either way.<br>Abilities that do not fit this description, even if they could hinder moves in some other way, are not affected.  For example, cursed-body only affects potential future uses of the move, while liquid-ooze and shadow-tag can only hinder a move''s effect on the user.  This ablity cannot ignore type or form changes granted by abilities, for example color-change or forecast; nor effects that were caused by abilities but are no longer tied to an ability, such as the rain from drizzle.  This ability cannot ignore multitype at all.<br>An ability ignored by this ability is only nullified while the move is being used.  For example, this Pokmon''s moves can paralyze a Pokmon with limber, but Limber will activate and heal the paralysis immediately thereafter, and this Pokmon''s spikes are not affected by this ability after they have been placed.<br>When this Pokmon enters battle, all participating trainers are notified that it has this ability.<br>This ability functions identically to mold-breaker and teravolt.', 'Moves can be used regardless of Abilities.', 'Moves can be used on the target regardless of its Abilities.', NULL, NULL, '11,15');
INSERT INTO abilities
VALUES
	(190, 'desolate land', 6, 'When this Pokmon enters battle or gains this ability, the weather becomes extremely harsh sunlight.  Extremely harsh sunlight has all the properties of sunny-day and also causes damaging Water moves to fail.<br>Extremely harsh sunlight ends when this Pokmon leaves battle or loses this ability, or when this ability is nullified.  The weather cannot otherwise be changed except by the effects of delta-stream and primordial-sea.<br>The abilities air-lock and cloud-nine will prevent the effects of extremely harsh sunlight, including allowing Water moves to work, but will not allow the weather to be changed.', 'Affects weather and nullifies any Water-type attacks.', 'The Pokmon changes the weather to nullify Water-type attacks.', NULL, NULL, '16,17');
INSERT INTO abilities
VALUES
	(231, 'shadow shield', 7, 'When this Pokmon has full HP, regular damage (not fixed damage!) from moves is halved.<br>This ability cannot be nullified.', 'Reduces the amount of damage the Pokmon takes while its HP is full.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(164, 'teravolt', 5, 'This Pokmon''s moves completely ignore abilities that could hinder or prevent their effect on the target.<br>For example, this Pokmon''s moves ignore abilities that would fully negate them, such as water-absorb; abilities that would prevent any of their effects, such as clear-body, shell-armor or sticky-hold; and abilities that grant any general protective benefit, such as simple, snow-cloak, or thick-fat.  If an ability could either hinder or help this Pokmon''s moves, e.g. dry-skin or unaware, the ability is ignored either way.<br>Abilities that do not fit this description, even if they could hinder moves in some other way, are not affected.  For example, cursed-body only affects potential future uses of the move, while liquid-ooze and shadow-tag can only hinder a move''s effect on the user.  This ablity cannot ignore type or form changes granted by abilities, for example color-change or forecast; nor effects that were caused by abilities but are no longer tied to an ability, such as the rain from drizzle.  This ability cannot ignore multitype at all.<br>An ability ignored by this ability is only nullified while the move is being used.  For example, this Pokmon''s moves can paralyze a Pokmon with limber, but Limber will activate and heal the paralysis immediately thereafter, and this Pokmon''s spikes are not affected by this ability after they have been placed.<br>When this Pokmon enters battle, all participating trainers are notified that it has this ability.<br>This ability functions identically to mold-breaker and turboblaze.', 'Moves can be used regardless of Abilities.', 'Moves can be used on the target regardless of its Abilities.', NULL, NULL, '11,15');
INSERT INTO abilities
VALUES
	(166, 'flower veil', 6, 'Protects friendly grass Pokmon from having their stats lowered by other Pokmon.', 'Prevents lowering of ally Grass-type Pokmon''s stats.', 'Ally Grass-type Pokmon are protected from status conditions and the lowering of their stats.', NULL, NULL, '15,17');
INSERT INTO abilities
VALUES
	(167, 'cheek pouch', 6, 'Restores HP upon eating a Berry, in addition to the Berry''s effect.', 'Restores HP as well when the Pokmon eats a Berry.', NULL, NULL, NULL, '15');
INSERT INTO abilities
VALUES
	(168, 'protean', 6, 'Changes the bearer''s type to match each move it uses.<br>The type change takes place just before the move is used.', 'Changes the Pokmon''s type to the type of the move it''s using.', 'Changes the Pokmon''s type to the type of themove it''s about to use.', NULL, NULL, '15,17');
INSERT INTO abilities
VALUES
	(169, 'fur coat', 6, 'Halves damage from physical attacks.', 'Halves damage from physical moves.', NULL, NULL, NULL, '15');
INSERT INTO abilities
VALUES
	(170, 'magician', 6, 'Steals the target''s held item when the bearer uses a damaging move.', 'The Pokmon steals the held item of a Pokmon it hits with a move.', NULL, NULL, NULL, '15');
INSERT INTO abilities
VALUES
	(171, 'bulletproof', 6, 'Protects against bullet, ball, and bomb-based moves.', 'Protects the Pokmon from some ball and bomb moves.', NULL, NULL, NULL, '15');
INSERT INTO abilities
VALUES
	(172, 'competitive', 6, 'Raises Special Attack by two stages upon having any stat lowered.', 'Boosts the Sp. Atk stat when a stat is lowered.', 'Boosts the Sp. Atk stat sharply when a stat is lowered.', NULL, NULL, '15,17');
INSERT INTO abilities
VALUES
	(173, 'strong jaw', 6, 'Strengthens biting moves to 1.5 their power.', 'The Pokmon''s strong jaw gives it tremendous biting power.', 'The Pokmon''s strong jaw boosts the power of its biting moves.', NULL, NULL, '15,17');
INSERT INTO abilities
VALUES
	(174, 'refrigerate', 6, 'Turns the bearer''s normal-type moves into ice-type moves.  Moves changed by this ability have 1.3 their power.', 'Normal-type moves become Ice-type moves.', 'Normal-type moves become Ice-type moves. The power of those moves is boosted a little.', NULL, NULL, '15,17');
INSERT INTO abilities
VALUES
	(175, 'sweet veil', 6, 'Prevents friendly Pokmon from sleeping.', 'Prevents itself and ally Pokmon from falling asleep.', NULL, NULL, NULL, '15');
INSERT INTO abilities
VALUES
	(176, 'stance change', 6, 'Changes Aegislash to Blade Forme before using a damaging move, or Shield Forme before using kings-shield.', 'The Pokmon changes form depending on how it battles.', 'The Pokmon changes its form to Blade Forme when it uses an attack move, and changes to Shield Forme when it uses King''s Shield.', NULL, NULL, '15,17');
INSERT INTO abilities
VALUES
	(177, 'gale wings', 6, 'Raises flying moves'' priority by one stage.', 'Gives priority to Flying-type moves.', 'Gives priority to Flying-type moves when the Pokmon''s HP is full.', NULL, NULL, '15,17');
INSERT INTO abilities
VALUES
	(178, 'mega launcher', 6, 'Strengthens aura and pulse moves to 1.5 their power.', 'Powers up aura and pulse moves.', NULL, NULL, NULL, '15');
INSERT INTO abilities
VALUES
	(179, 'grass pelt', 6, 'Boosts Defense while grassy-terrain is in effect.', 'Boosts the Defense stat in Grassy Terrain.', 'Boosts the Pokmon''s Defense stat in Grassy Terrain.', NULL, NULL, '179');
INSERT INTO abilities
VALUES
	(180, 'symbiosis', 6, 'Passes the bearer''s held item to an ally when the ally uses up its item.', 'The Pokmon can pass an item to an ally.', 'The Pokmon passes its item to an ally that has used up an item.', NULL, NULL, '15,17');
INSERT INTO abilities
VALUES
	(181, 'tough claws', 6, 'Strengthens moves that make contact to 1.33 their power.', 'Powers up moves that make direct contact.', NULL, NULL, NULL, '15');
INSERT INTO abilities
VALUES
	(182, 'pixilate', 6, 'Turns the bearer''s normal-type moves into fairy moves.  Moves changed by this ability have 1.3 their power.', 'Normal-type moves become Fairy-type moves.', 'Normal-type moves become Fairy-type moves. The power of those moves is boosted a little.', NULL, NULL, '15,17');
INSERT INTO abilities
VALUES
	(183, 'gooey', 6, 'Lowers attacking Pokmon''s Speed by one stage on contact.', 'Contact with the Pokmon lowers the attacker''s Speed stat.', NULL, NULL, NULL, '15');
INSERT INTO abilities
VALUES
	(184, 'aerilate', 6, 'Turns the bearer''s normal-type moves into flying-type moves.  Moves changed by this ability have 1.3 their power.', 'Normal-type moves become Flying-type moves.', 'Normal-type moves become Flying-type moves. The power of those moves is boosted a little.', NULL, NULL, '15,17');
INSERT INTO abilities
VALUES
	(185, 'parental bond', 6, 'Lets the bearer hit twice with damaging moves.  The second hit has half power.', 'Parent and child attack together.', 'Parent and child each attacks.', NULL, NULL, '15,17');
INSERT INTO abilities
VALUES
	(186, 'dark aura', 6, 'Strengthens dark-type moves for all friendly and opposing Pokmon.', 'Powers up each Pokmon''s Dark-type moves.', NULL, NULL, NULL, '15');
INSERT INTO abilities
VALUES
	(187, 'fairy aura', 6, 'Strengthens fairy-type moves for all friendly and opposing Pokmon.', 'Powers up each Pokmon''s Fairy-type moves.', NULL, NULL, NULL, '15');
INSERT INTO abilities
VALUES
	(188, 'aura break', 6, 'While this Pokmon is on the field, dark-aura and fairy-aura weaken moves of their respective types to 2/3 their power, rather than strengthening them.', 'The effects of Aura Abilities are reversed.', 'The effects of Aura Abilities are reversed to lower the power of affected moves.', NULL, NULL, '15,17');
INSERT INTO abilities
VALUES
	(189, 'primordial sea', 6, 'When this Pokmon enters battle or gains this ability, the weather becomes heavy rain.  Heavy rain has all the properties of rain-dance and also causes damaging Fire moves to fail.<br>Heavy rain ends when this Pokmon leaves battle or loses this ability, or when this ability is nullified.  The weather cannot otherwise be changed except by the effects of delta-stream and desolate-land.<br>The abilities air-lock and cloud-nine will prevent the effects of heavy rain, including allowing Fire moves to work, but will not allow the weather to be changed.', 'Affects weather and nullifies any Fire-type attacks.', 'The Pokmon changes the weather to nullify Fire-type attacks.', NULL, NULL, '16,17');
INSERT INTO abilities
VALUES
	(223, 'power of-alchemy', 7, 'When an ally faints, this Pokmon gains its Ability.', 'The Pokmon copies the Ability of a defeated ally.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(191, 'delta stream', 6, 'When this Pokmon enters battle or gains this ability, the weather becomes a mysterious air current.  A mysterious air current causes moves to not be super effective against Flying; they do neutral damage instead.  The ability anticipation and move stealth-rock are not affected.<br>The mysterious air current ends when this Pokmon leaves battle or loses this ability, or when this ability is nullified.  The weather cannot otherwise be changed except by the effects of desolate-land and primordial-sea.<br>The abilities air-lock and cloud-nine will prevent the effect of a mysterious air current, but will not allow the weather to be changed.', 'Affects weather and eliminates all of the Flying type''s weaknesses.', 'The Pokmon changes the weather to eliminate all of the Flying type''s weaknesses.', NULL, NULL, '16,17');
INSERT INTO abilities
VALUES
	(192, 'stamina', 7, 'Raises this Pokmon''s Defense by one stage when it takes damage from a move.', 'Boosts the Defense stat when hit by an attack.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(193, 'wimp out', 7, 'After this Pokmon is hit by a move, if that move caused this Pokmon''s HP to drop below half, it switches out.', 'The Pokmon cowardly switches out when its HP becomes half or less.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(194, 'emergency exit', 7, 'After this Pokmon is hit by a move, if that move caused this Pokmon''s HP to drop below half, it switches out.', 'The Pokmon, sensing danger, switches out when its HP becomes half or less.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(195, 'water compaction', 7, 'Raises this Pokmon''s Defense by two stages when it''s hit by a Water move.', 'Boosts the Pokmon''s Defense stat sharply when hit by a Water-type move.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(196, 'merciless', 7, 'This Pokmon''s moves critical hit against poisoned targets.', 'The Pokmon''s attacks become critical hits if the target is poisoned.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(199, 'water bubble', 7, 'When this Pokmon is hit by a Fire move, the damage is halved.  When this Pokmon uses a Water move, the power is doubled.  This Pokmon cannot be burned, and if it becomes burned, the  burn is immediately cured.', 'Lowers the power of Fire-type moves done to the Pokmon and prevents the Pokmon from getting a burn.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(200, 'steelworker', 7, 'This Pokmon''s Steel moves have 1.5 power.', 'Powers up Steel-type moves.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(201, 'berserk', 7, 'Whenever this Pokmon takes damage from a move that causes its HP to drop below 50%, its Special Attack rises by one stage.', 'Boosts the Pokmon''s Sp. Atk stat when it takes a hit that causes its HP to become half or less.', NULL, NULL, NULL, '17');
INSERT INTO abilities
