INSERT INTO abilities
VALUES
	(206, 'galvanize', 7, 'When this Pokmon uses a Normal moves, that move is Electric its power is 1.2.', 'Normal-type moves become Electric-type moves. The power of those moves is boosted a little.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(207, 'surge surfer', 7, 'Doubles this Pokmon''s Speed on Electric Terrain.', 'Doubles the Pokmon''s Speed stat on Electric Terrain.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(208, 'schooling', 7, 'If this Pokmon is a Wishiwashi and level 20 or above, then when it enters battle and at the start of each turn, it becomes Schooling Form if its HP is 25% or higher and Solo Form otherwise.<br>This ability cannot be replaced, copied, or nullified.', 'When it has a lot of HP, the Pokmon forms a powerful school. It stops schooling when its HP is low.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(209, 'disguise', 7, 'If this Pokmon is in its Disguised Form and takes damage from a move, it switches to its Busted Form and the damage is prevented.  Other effects are not prevented.<br>This ability cannot be copied or replaced.  This ability only takes effect for Mimikyu.', 'Once per battle, the shroud that covers the Pokmon can protect it from an attack.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(210, 'battle bond', 7, 'Transforms this Pokmon into Ash-Greninja after fainting an opponent.  Water Shuriken''s power is 20 and always hits three times.<br>This ability cannot be copied or replaced.  This ability only takes effect for Greninja.', 'Defeating an opposing Pokmon strengthens the Pokmon''s bond with its Trainer, and it becomes Ash-Greninja. Water Shuriken gets more powerful.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(211, 'power construct', 7, 'Transforms 10% or 50% Zygarde into Complete Forme when its HP is below 50%.<br>This ability cannot be copied or replaced.  This ability only takes effect for Zygarde.', 'Other Cells gather to aid when its HP becomes half or less. Then the Pokmon changes its form to Complete Forme.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(212, 'corrosion', 7, 'This Pokmon''s moves and item ignore the usual immunity of Poison and Steel Pokmon when attempting to inflict poison.', 'The Pokmon can poison the target even if it''s a Steel or Poison type.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(213, 'comatose', 7, 'This Pokmon always acts as though it were Asleep.  It cannot be given another status ailment; it''s unaffected by yawn; it can use sleep-talk; and so on.', 'It''s always drowsing and will never wake up. It can attack without waking up.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(214, 'queenly majesty', 7, 'When an opposing Pokmon attempts to use a move that targets this Pokmon or an ally, and that move has priority, it will fail.', 'Its majesty pressures the opposing Pokmon, making it unable to attack using priority moves.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(215, 'innards out', 7, 'When this Pokmon faints from an opponent''s move, that opponent takes damage equal to the HP this Pokmon had remaining.', 'Damages the attacker landing the finishing hit by the amount equal to its last HP.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(216, 'dancer', 7, 'Whenever another Pokmon uses a dance move, this Pokmon will use the same move immediately afterwards.', 'When another Pokmon uses a dance move, it can use a dance move following it regardless of its Speed.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(217, 'battery', 7, 'Ally Pokmon''s moves have their power increased to 1.3.', 'Powers up ally Pokmon''s special moves.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(218, 'fluffy', 7, 'Damage from contact moves is halved.  Damage from Fire moves is doubled.', 'Halves the damage taken from moves that make direct contact, but doubles that of Fire-type moves.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(219, 'dazzling', 7, 'When an opposing Pokmon attempts to use a move that targets this Pokmon or an ally, and that move has priority, it will fail.', 'Surprises the opposing Pokmon, making it unable to attack using priority moves.', NULL, NULL, NULL, '17');
INSERT INTO abilities
VALUES
	(220, 'soul heart', 7, 'This Pokmon''s Special Attack rises by one stage every time any Pokmon faints.', 'Boosts its Sp. Atk stat every time a Pokmon faints.', NULL, NULL, NULL, '17');
