VALUES
	(221, 'tangling hair', 7, 'When this Pokmon takes regular damage from a contact move, the attacking Pokmon''s Speed lowers by one stage.', 'Contact with the Pokmon lowers the attacker''s Speed stat.', NULL, NULL, NULL, '17');
